    super(props);
  }

  render() {
    return (
      <Col className="mb-4">
      <Card>
           <CardBody>
           <div>
             <h4>{menus.label}</h4>
           </div>
           <div>{menus.image}</div> 
           <div>{menus.price}</div>
           </CardBody>
         </Card>
       </Col>
    );
  }
}

MenuCard.propTypes = {
  label: PropTypes.string,
  image: PropTypes.string,
  price: PropTypes.string,
};

export default MenuCard;
